import companyLogo from "../../../../Asset/images/companylogo.png";
const Jobs = (props) => {
  <Card>
    <Row>
      <Col>
        <img src={companyLogo} alt="CompanyLogo" />
      </Col>
      <Col>Amazon</Col>
    </Row>
   <Row>Quy</Row>
  </Card>;
};
export default Jobs;
